import React from "react";
import { Draggable, Droppable } from "react-dnd-html5-backend";

const StaffList = ({ staff, onDrop }) => {
  return (
    <div>
        <div className="outerBox">
          {staff.map((staff, index) => (
            <Draggable key={index} subject={staff}>
              <div className="staffName">{staff}</div>
            </Draggable>
          ))}
        </div>
    </div>
  );
};

export default StaffList;
